/*eslint-disable*/

import { useEffect } from "react";
import { Chart } from "react-google-charts";

function ShowChart(props) {
  const data = [["Name", "Number"]];
  for (var i in props.result) {
    data.push(props.result[i]);
  }

  const options = {
    title: "Hello",
    width: 600,
    height: 400,
    bar: { groupWidth: "95%" },
    legend: { position: "none" },
  };
  const chart = (
    <Chart
      chartType="BarChart"
      width="100%"
      height="400px"
      data={data}
      options={options}
    />
  );

  //차트 만들기
  useEffect(() => {});

  return (
    <>
      <h1>{props.result}</h1>
      {chart}
    </>
  );
}

export default ShowChart;
